import React from "react";
import "./Dictonary.css";

export default function Dictonary() {
  function search(event) {
    event.preventDefault();
    alert("Searching");
  }
  return;
  <div className="Dictonary">
    <form onSubmit={search}>
      <input type="search" autoFocus={true} />
    </form>
  </div>;
}
